import { useEffect, useState } from 'react';
import axios from 'axios';
import Table from 'react-bootstrap/Table';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Modal from 'react-bootstrap/Modal';

function Example() {
    // const [show, setShow] = useState(false);
    const [show, setShow] = useState(false);
    const [product, setProduct] = useState([])
    const [title, setTitle] = useState("");
    const [description, setDescription] = useState("");
    const [price, setPrice] = useState("");
    const [variant, setVariant] = useState("");
    const [id, setId] = useState("");


    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);


    useEffect(() => {
        getProduct();
    }, [])

    const getProduct = () => {
        axios.get('http://localhost:5002/notes')
            .then((res) => {
                setProduct(res.data.data);
                // console.log(res.data.data);
            })
    }

    const handleCustomer = (e) => {
        e.preventDefault();

        if (id) {
            axios.put("http://localhost:5002/notes", { id, title, description, variant, price })
                .then((response) => {
                    getProduct("");
                    setId("");
                    setTitle("");
                    setVariant("")
                    setDescription("");
                    setPrice("")


                })


        } else {
            axios.post("http://localhost:5002/notes", { id, title, description, variant, price })
                .then((response) => {
                    getProduct("");
                    setId("");
                    setTitle("");
                    setVariant("");
                    setDescription("");
                    setPrice("")
                    clearForm("");

                })

        }
    }
    const clearForm = () => {
        setId("");
        setTitle("");
        setVariant("");
        setDescription("");
        setPrice("")
    }
    const handleDelete = async (noteId) => {
        try {
            const response = await axios.delete('http://localhost:5002/notes', { data: { id: noteId } })
            console.log(response.data.data);
            getProduct();
        } catch (error) {
            console.error("There was an error deleting the user!", error);
        }
    };
    const userform = (noteData) => {
        setId(noteData.id);
        setProduct(noteData.product);
        setDescription(noteData.description);
        setVariant(noteData.variant);
        setPrice(noteData.price);
    }

    return (
        <>
            <Button variant="primary" onClick={handleShow}>
                Contact Us
            </Button>

            <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                    <Modal.Title>Contact</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <Form onSubmit={handleCustomer}>
                        <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
                            <Form.Label>Name</Form.Label>
                            <Form.Control
                                type="text"
                                placeholder="Enter Your Name"
                                autoFocus
                            />
                        </Form.Group>
                        <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
                            <Form.Label>Email address</Form.Label>
                            <Form.Control
                                type="email"
                                placeholder="Email address"
                                autoFocus
                            />
                        </Form.Group>
                        <Form.Group
                            className="mb-3"
                            controlId="exampleForm.ControlTextarea1"
                        >
                            <Form.Label>Example textarea</Form.Label>
                            <Form.Control as="textarea" rows={3} />
                        </Form.Group>
                    </Form>
                </Modal.Body>
                <Modal.Footer>

                    <Button variant="primary" onClick={handleClose}>
                        {id ? 'Update' : 'Submit'}
                    </Button>
                </Modal.Footer>
            </Modal>
            <Table striped bordered hover>
                <thead>
                    <tr>
                        <th>Id</th>
                        <th>Name</th>
                        <th>Email</th>
                        <th>Message</th>
                    </tr>
                </thead>
                <tbody>
                    {product.map(data => (
                        <>
                            <tr key={data.id}>
                                <td>{data._id}</td>
                                <td>{data.title}</td>
                                <td>{data.description}</td>
                                <td>{data.variant}</td>
                                <td>{data.price}</td>
                                <Button variant="primary" onClick={() => userform(data)} >Edit</Button>
                                <Button variant="danger" onClick={() => handleDelete(data.id)} >Delete</Button>
                            </tr>
                        </>
                    ))}
                </tbody>
            </Table >
        </>
    );
}

export default Example;
